# test_consultar_extrato_pdf.py

import unittest
from unittest.mock import MagicMock, patch

from decouple import config

from bancointer.banking.extrato import ConsultaExtratoPDF
from bancointer.utils.token_utils import token_file_is_exist
from bancointer.utils.environment import Environment


class TestConsultarExtratoPDF(unittest.TestCase):

    def setUp(self):
        self.client_id = config("CLIENT_ID")
        self.client_secret = config("CLIENT_SECRET")
        self.cert = (
            config("SSL_DIR_BASE") + config("PUBLIC_KEY_V2"),
            config("SSL_DIR_BASE") + config("PRIVATE_KEY_V2"),
        )
        self.conta_corrente = config("X_INTER_CONTA_CORRENTE")

    @patch("http.client.HTTPSConnection")
    def test_consultar_extrato_pdf_success(self, mock_https_connection):
        # Mock da resposta para o token de acesso
        mock_token_response = MagicMock()
        mock_token_response.read.return_value = b'{"access_token": "5e5b232a-381a-477d-83b5-4ac65b6a0679", "token_type": "Bearer", "expires_in": 3600, "scope": "boleto-cobranca.read boleto-cobranca.write", "expires_at": "2024-11-08 07:17:36.580932"}'
        mock_token_response.status = 200

        # Cria um mock para a resposta
        response_json = b'{"pdf":""}'

        mock_data_response = MagicMock()
        mock_data_response.read.return_value = response_json
        mock_data_response.status = 200

        # Configura o mock para a segunda chamada (dados), se token nao existe configura side_effect
        if token_file_is_exist():
            mock_https_connection.return_value.getresponse.return_value = (
                mock_data_response
            )
        else:
            mock_https_connection.return_value.getresponse.side_effect = [
                mock_token_response,
                mock_data_response,
            ]

        consulta_extrato_pdf = ConsultaExtratoPDF(
            Environment.SANDBOX,
            self.client_id,
            self.client_secret,
            self.cert,
            self.conta_corrente,
        )

        response_success = consulta_extrato_pdf.consultar_pdf(
            "2024-01-23", "2024-02-13", config("DOWNLOAD_PATH")
        )

        self.assertEqual(response_success, True)

    @patch("http.client.HTTPSConnection")
    def test_consultar_extrato_pdf_failure(self, mock_https_connection):
        # Mock da resposta para o token de acesso
        mock_token_response = MagicMock()
        mock_token_response.read.return_value = b'{"access_token": "5e5b232a-381a-477d-83b5-4ac65b6a0679", "token_type": "Bearer", "expires_in": 3600, "scope": "boleto-cobranca.read boleto-cobranca.write", "expires_at": "2024-11-08 07:17:36.580932"}'
        mock_token_response.status = 200

        # Cria um mock para a resposta
        response_json = b'{"pdf":""}'

        mock_data_response = MagicMock()
        mock_data_response.read.return_value = response_json
        mock_data_response.status = 200

        # Configura o mock para a segunda chamada (dados), se token nao existe configura side_effect
        if token_file_is_exist():
            mock_https_connection.return_value.getresponse.return_value = (
                mock_data_response
            )
        else:
            mock_https_connection.return_value.getresponse.side_effect = [
                mock_token_response,
                mock_data_response,
            ]

        consulta_extrato_pdf = ConsultaExtratoPDF(
            Environment.SANDBOX,
            self.client_id,
            self.client_secret,
            self.cert,
            self.conta_corrente,
        )

        response = consulta_extrato_pdf.consultar_pdf(
            "", "2024-02-13", config("DOWNLOAD_PATH")
        )

        self.assertEqual(
            response, {"codigo": 502, "descricao": "Periodo de datas invalido"}
        )


if __name__ == "__main__":
    unittest.main()
